L["You can paste any text contains coordinates here, and press ENTER to set the waypoint in map."] = "你可以在這裡貼上任何包含座標的文字, 並按下 輸入鍵(Enter) 設定地圖標記."
L["You can preview the ease type in https://easings.net/"] = "你可以在 https://easings.net/ 預覽緩動函數的效果."
L["You can send your suggestions or bugs via %s, %s, %s and the thread in %s."] = "你可以透過 %s, %s, %s 和在 %s 的帖子來回報錯誤和建議."
